const tweetStreamContainer = document.getElementById('tweet-stream');
const tweetForm = document.getElementById('tweet-form');
const DEFAULT_USER = 'lucy';

var state = {};
state.showTweetForm = false;
state.following = [DEFAULT_USER, 'Mildred'];
state.filterBy = 'all';

function tweetToElement(tweet) {
  var rowElement = document.createElement('div');
  var tweetElement = document.createElement('div');
  var panelHeadingElement = document.createElement('div');
  var tweetContentElement = document.createElement('p');
  var followElement = document.createElement('a');

  followElement.dataset.user_name = tweet.user_name;

  rowElement.className = 'row';
  tweetElement.className = 'panel panel-default';
  panelHeadingElement.className = 'panel-heading';
  tweetContentElement.className += 'panel-body';
  followElement.className += 'follow pull-right';
  followElement.textContent = 'Follow';

  rowElement.appendChild(tweetElement);
  tweetElement.appendChild(panelHeadingElement);
  tweetElement.appendChild(tweetContentElement);


  panelHeadingElement.textContent = tweet.user_name + ' on ' + tweet.date;
  tweetContentElement.textContent = tweet.content;
  panelHeadingElement.appendChild(followElement);

  return rowElement;
}

function sortTweetsByDate(a, b) {
  if (a.date > b.date) {
    return 1;
  }
  if (a.date < b.date) {
    return -1;
  }
  return 0;
}

function newTweet(date, userName, content) {
  var tweet = {};

  date = new Date(date);

  tweet.date = date.toISOString();
  tweet.user_name = DEFAULT_USER;
  tweet.content = content;

  return tweet;
}


//effects
function render() {
  //clear tweets and re-append them
  tweetStreamContainer.innerHTML = '';

  const tweetStreamFiltered = tweetStream.filter(function(tweet){
    if(state.filterBy === 'all'){
      return true; 
    } else {
      return state.following.includes(tweet.user_name); 
    }
  });


  const tweetStreamSorted = tweetStreamFiltered.sort(sortTweetsByDate).reverse();
  const tweetElements = tweetStreamSorted.map(tweetToElement);

  for (var element of tweetElements) {
    tweetStreamContainer.appendChild(element);
  }


  //show or hide the tweet form
  //fixme
  const x = {
    true: 'remove',
    false: 'add'
  };
  tweetForm.classList[x[state.showTweetForm]]('hidden');
}

document.body.addEventListener('click', function(e) {
  if (e.target.id === 'new-tweet-link') {
    state.showTweetForm = !state.showTweetForm;

    render();
  } else if (e.target.id === 'tweet-submit') {

    tweetStream = tweetStream.concat(
      newTweet(
        Date.now(),
        DEFAULT_USER,
        e.target.form[0].value));


    render();
  } else if (e.target.classList.contains('follow')){

    if(!state.following.includes(e.target.dataset.user_name)){
      state.following = state.following.concat(e.target.dataset.user_name);

      render();
    }
  } else if (e.target.classList.contains('filter-link')){
    state.filterBy = e.target.dataset.filter;

    render();
}
});
window.onload = render;
